import React, { useState } from 'react';
import { picId } from './home';


const Display = () => {
    console.log(picId)
    return (
        <div>
            <h1>{picId.map(item => {
                return <li>{item[0]}</li>;
            })}</h1>
        </div>
    );
};

export default Display;
